  - name: issueRequest(string, RequestInit, IVssRequestOptions)
    uid: azure-devops-extension-api.issueRequest
    package: azure-devops-extension-api
    summary: >-
      Issue a fetch request. This is a wrapper around the browser fetch method
      that handles VSS authentication

      and triggers events that can be listened to by other modules.
    remarks: ''
    isDeprecated: false
    syntax:
      content: >-
        function issueRequest(requestUrl: string, options?: RequestInit,
        vssRequestOptions?: IVssRequestOptions): Promise<Response>
      parameters:
        - id: requestUrl
          type: string
          description: Url to send the request to
        - id: options
          type: RequestInit
          description: fetch settings/options for the request
        - id: vssRequestOptions
          type: <xref uid="azure-devops-extension-api.IVssRequestOptions" />
          description: |-
            VSS specific request options

            Triggered Events:
             afterRequest -> IPostRequestEvent is sent after the request has completed.
             beforeRequest -> IPreRequestEvent is sent before the request is made.
      return:
        description: ''
        type: Promise&lt;Response&gt;
  - name: deserializeVssJsonObject<T>(string)
    uid: azure-devops-extension-api.deserializeVssJsonObject
    package: azure-devops-extension-api
    summary: >-
      Handle the raw text of a JSON response which may contain MSJSON style
      dates and

      deserialize (JSON.parse) the data in a way that restores Date objects
      rather than

      strings.


      MSJSON style dates are in the form:

          "lastModified": "/Date(1496158224000)/"

      This format unnecessarily (but intentionally) escapes the "/" character.
      So the parsed

      JSON will have no trace of the escape character (\).
    remarks: ''
    isDeprecated: false
    syntax:
      content: 'function deserializeVssJsonObject<T>(text: string): T | null'
      parameters:
        - id: text
          type: string
          description: The raw JSON text
      return:
        description: ''
        type: T | null
  - name: combineUrlPaths(string[])
    uid: azure-devops-extension-api.combineUrlPaths
    package: azure-devops-extension-api
    summary: >-
      Take url segments and join them with a single slash character. Takes care
      of path segements that start and/or end

      with a slash to ensure that the resulting URL does not have double-slashes
    remarks: ''
    isDeprecated: false
    syntax:
      content: 'function combineUrlPaths(paths: string[]): string'
      parameters:
        - id: paths
          type: string[]
          description: Path segments to concatenate
      return:
        description: ''
        type: string
  - name: 'getBestRouteMatch(IParsedRoute[], {[name: string]: string})'
    uid: azure-devops-extension-api.getBestRouteMatch
    package: azure-devops-extension-api
    summary: >-
      Take a set of routes and find the best match. The best match is the route
      with the highest number of replacements

      (of the given routeValues dictionary). In the event of a tie (same number
      of replacements) the route that came first wins.
    remarks: ''
    isDeprecated: false
    syntax:
      content: >-
        function getBestRouteMatch(routeCollection: IParsedRoute[], routeValues:
        {[name: string]: string}): IRouteMatchResult | undefined
      parameters:
        - id: routeCollection
          type: <xref uid="azure-devops-extension-api.IParsedRoute" />[]
          description: Array of parsed routes
        - id: routeValues
          type: '{[name: string]: string}'
          description: Replacement values
      return:
        description: ''
        type: >-
          <xref uid="azure-devops-extension-api.IRouteMatchResult" /> |
          undefined
  - name: parseRouteTemplate(string)
    uid: azure-devops-extension-api.parseRouteTemplate
    package: azure-devops-extension-api
    summary: >-
      Parse a route template into a structure that can be used to quickly do
      route replacements
    remarks: ''
    isDeprecated: false
    syntax:
      content: 'function parseRouteTemplate(routeTemplate: string): IParsedRoute'
      parameters:
        - id: routeTemplate
          type: string
          description: MVC route template string (like "/foo/{id}/{*params}")
      return:
        description: ''
        type: <xref uid="azure-devops-extension-api.IParsedRoute" />
  - name: >-
      replaceParsedRouteValues(IParsedRoute, {[name: string]: string | number |
      undefined}, boolean)
    uid: azure-devops-extension-api.replaceParsedRouteValues
    package: azure-devops-extension-api
    summary: Replace route values for a specific parsed route
    remarks: ''
    isDeprecated: false
    syntax:
      content: >-
        function replaceParsedRouteValues(parsedRoute: IParsedRoute,
        routeValues: {[name: string]: string | number | undefined},
        continueOnUnmatchedSegements?: boolean): IRouteMatchResult | undefined
      parameters:
        - id: parsedRoute
          type: <xref uid="azure-devops-extension-api.IParsedRoute" />
          description: The route to evaluate
        - id: routeValues
          type: '{[name: string]: string | number | undefined}'
          description: Dictionary of route replacement parameters
        - id: continueOnUnmatchedSegements
          type: boolean
          description: >-
            If true, continue with replacements even after a miss. By default
            (false), stop replacements once a parameter is not present.
      return:
        description: ''
        type: >-
          <xref uid="azure-devops-extension-api.IRouteMatchResult" /> |
          undefined
  - name: 'replaceRouteValues(string, {[name: string]: string | number | undefined})'
    uid: azure-devops-extension-api.replaceRouteValues
    package: azure-devops-extension-api
    summary: >-
      Take an MVC route template (like "/foo/{id}/{*params}") and replace the
      templated parts with values from the given dictionary
    remarks: ''
    isDeprecated: false
    syntax:
      content: >-
        function replaceRouteValues(routeTemplate: string, routeValues: {[name:
        string]: string | number | undefined}): string
      parameters:
